// Email Sending event
function Email_Sending(&$Email, &$Args) {
	//var_dump($Email); var_dump($Args); exit();

	$Email->Recipient = $Args["rsnew"]["resource_id"]; // Change recipient to a field value in the new record            
	$Email->Subject = "My New Subject"; // Change subject
	$Email->Content = "\nAdded by " . CurrentUserName(); // Append additional content

//   kindly be informed that you assigned to project name from to  the percentage

	return TRUE;                 
}

// Row Inserted event
function Row_Inserted($rsold, &$rsnew) {
	//echo "Row Inserted" 
  $adays =  $rsnew["days"] ;
			   $resource= $rsnew["resource_id"];
						   $apercentage=$rsnew["percentage"];
				$mandayratevalue = ew_ExecuteScalar("SELECT mandayrate  FROM mandayrate WHERE resource_id = '".$resource."';");
												  $ashadow =$rsnew["shadow"];  
								$acost= $adays * $mandayratevalue *$apercentage*$ashadow / 100;
		  //      $datediff=   date_diff($rsnew["allocation_to"], $rsnew["allocation_from"]); 
			ew_Execute("update allocation set cost= ".$acost." where id= ".$rsnew["id"].";");   




}

